    public int solution(String s) {
        if (s == null || s.equals("") || s.length() == 0)
            return 0;

        int longest = 0;
        int tempLongest = 0;
        int nextSpot;
        for (int i = 0; i < s.length(); i++) {
            char c = s.charAt(i);
            String x = s.substring(i + 1, s.length());
            nextSpot = x.indexOf(c);
            if (nextSpot == 0) {
                if (longest <= tempLongest)
                    longest = tempLongest + 1;
                tempLongest = 0;
            } else if (nextSpot > 0) {
                if(longest > tempLongest + nextSpot + 1)
                    continue;
                x = x.substring(0, nextSpot);
                if (function1(x)) {
                    tempLongest = tempLongest + nextSpot + 1;
                    longest = (longest < tempLongest) ? tempLongest : longest;
                    tempLongest = 0;
                } else {
                    tempLongest++;
                }
            } else {
                tempLongest++;
            }
        }
        if (tempLongest > longest)
            return tempLongest;
        return longest;
    }

    public boolean function1(String s) {
        for (int i = 0; i < s.length() - 1; i++) {
            String sub = s.charAt(i) + "";
            String x = s.substring(i + 1, s.length());
            boolean flag = x.contains(sub);
            if (flag)
                return false;
        }
        return true;
    }

    public int betterSolution(String s){
        int n = s.length();
        Set<Character> set = new HashSet<>();
        int ans = 0;
        int i = 0;
        int j = 0;
        while(i < n && j < n){
            if(!set.contains(s.charAt(j))) {
                set.add(s.charAt(j));
                j++;
                ans = Math.max(ans, j - i);
            } else {
                set.remove(s.charAt(i));
                i++;
            }
        }
        return ans;
    }
